import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Register from './components/User_Management/Register';
import Login from './components/User_Management/Login';
import Profile from './components/User_Management/Profile';
import OAuthSuccess from './components/User_Management/OAuthSuccess';
import Home from './components/User_Management/Home';
import AdminDashboard from './components/User_Management/AdminDashboard';
import './App.css';
import './index.css'; 



function App() {
  return (
    <Router>
      <div className="navbar">
        <Link to="/">Home</Link>
        <Link to="/register">Register</Link>
        <Link to="/login">Login</Link>
        <Link to="/profile">Profile</Link>
        <Link to="/admin">Admin</Link>
      </div>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/profile" element={<UserProfile />} />
        <Route path="/admin" element={<AdminDashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
